import React, { Component } from "react";
import { Link } from "react-router-dom";

class Navbar extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <nav className="navbar navbar-expand-lg navbar-light bg-success justify-content-center">
        <div
          className="navbar-nav nav-fill justify-content-between"
          id="navbarSupportedContent"
        >
          <div className="nav-item px-5">
            <button
              onClick={this.props.onToggleSound}
              className="nav-link btn btn-outline-primary"
            >
              sound ${this.props.pageSound ? "on" : "off"}
            </button>
          </div>
          <div className="nav-item px-5">
            <button
              onClick={this.props.onToggleAnimation}
              className="nav-link btn btn-outline-primary"
            >
              animation ${this.props.pageAnimation ? "on" : "off"}
            </button>
          </div>
          <div className="nav-item px-5">
            <Link to="/stickers" className="nav-link btn btn-outline-primary">
              choose sticker
            </Link>
          </div>
          <div className="nav-item px-5">
            <Link to="/board" className="nav-link btn btn-outline-primary">
              new board
            </Link>
          </div>
          <div className="nav-item px-5">
            <Link to="/home" className="nav-link btn btn-outline-primary">
              my students
            </Link>
          </div>
          <div className="nav-item px-5">
            <button
              onClick={this.props.onLogout}
              className="nav-link btn btn-outline-primary"
            >
              log out
            </button>
          </div>
        </div>
      </nav>
    );
  }
}

export default Navbar;
